module.exports = "<article><nz-affix class=\"toc-affix\" [nzOffsetTop]=\"16\">\n    <nz-anchor [nzAffix]=\"false\" nzShowInkInFixed (nzClick)=\"goLink($event)\">\n      <nz-link nzHref=\"#components-message-demo-info\" nzTitle=\"普通提示\"></nz-link><nz-link nzHref=\"#components-message-demo-other\" nzTitle=\"其他提示类型\"></nz-link><nz-link nzHref=\"#components-message-demo-duration\" nzTitle=\"修改延时\"></nz-link><nz-link nzHref=\"#components-message-demo-loading\" nzTitle=\"加载中\"></nz-link>\n    </nz-anchor>\n  </nz-affix><section class=\"markdown\">\n\t<h1>Message<span class=\"subtitle\">全局提示</span>\n\t<a class=\"edit-button\" href=\"https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/message/doc/index.zh-CN.md\" target=\"_blank\">\n\t\t<i nz-icon type=\"edit\"></i></a>\n</h1>\n\t<section class=\"markdown\" ngNonBindable>\n\t\t<p>全局展示操作反馈信息。</p>\n<h2 id=\"何时使用\"><span>何时使用</span><a onclick=\"window.location.hash = '何时使用'\" class=\"anchor\">#</a></h2><ul>\n<li>可提供成功、警告和错误等反馈信息。</li>\n<li>顶部居中显示并自动消失，是一种不打断用户操作的轻量级提示方式。</li>\n</ul>\n<h2 id=\"如何使用\"><span>如何使用</span><a onclick=\"window.location.hash = '如何使用'\" class=\"anchor\">#</a></h2><p>如果要修改全局默认配置，你可以设置提供商 <code>NZ_MESSAGE_CONFIG</code> 的值来修改。\n（如：在你的模块的<code>providers</code>中加入 <code>&#123; provide: NZ_MESSAGE_CONFIG, useValue: &#123; nzDuration: 3000 &#125;&#125;</code>，<code>NZ_MESSAGE_CONFIG</code> 可以从 <code>ng-zorro-antd</code> 中导入）</p>\n<p>默认全局配置为：</p>\n<pre><code class=\"lang-js\"><span class=\"token punctuation\">&#123;</span>\n  nzDuration<span class=\"token punctuation\">:</span> <span class=\"token number\">3000</span><span class=\"token punctuation\">,</span>\n  nzMaxStack<span class=\"token punctuation\">:</span> <span class=\"token number\">7</span><span class=\"token punctuation\">,</span>\n  nzPauseOnHover<span class=\"token punctuation\">:</span> <span class=\"token boolean\">true</span><span class=\"token punctuation\">,</span>\n  nzAnimate<span class=\"token punctuation\">:</span> <span class=\"token boolean\">true</span>\n<span class=\"token punctuation\">&#125;</span>\n</code></pre>\n\n\t</section>\n\t\n\t<h2>\n\t\t<span>代码演示</span>\n\t\t<i nz-icon type=\"appstore\" class=\"code-box-expand-trigger\" title=\"展开全部代码\" (click)=\"expandAllCode()\"></i>\n\t</h2>\n</section><div nz-row [nzGutter]=\"16\">\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"普通提示\" [nzId]=\"'components-message-demo-info'\" nzSelector=\"nz-demo-message-info\" [nzLink]=\"'components-message-demo-info'\" nzGenerateCommand=\"ng g ng-zorro-antd:message-info -p app --name=\" nzComponentName=\"NzDemoMessageInfoComponent\" [nzCode]=\"info\" [nzRawCode]=\"infoRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/message/demo/info.md'\">\n\t<nz-demo-message-info demo></nz-demo-message-info>\n\t<div intro ngNonBindable>\n\t\t<p>信息提醒反馈。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"修改延时\" [nzId]=\"'components-message-demo-duration'\" nzSelector=\"nz-demo-message-duration\" [nzLink]=\"'components-message-demo-duration'\" nzGenerateCommand=\"ng g ng-zorro-antd:message-duration -p app --name=\" nzComponentName=\"NzDemoMessageDurationComponent\" [nzCode]=\"duration\" [nzRawCode]=\"durationRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/message/demo/duration.md'\">\n\t<nz-demo-message-duration demo></nz-demo-message-duration>\n\t<div intro ngNonBindable>\n\t\t<p>自定义时长 <code>10s</code>，默认时长为 <code>3s</code>。</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"其他提示类型\" [nzId]=\"'components-message-demo-other'\" nzSelector=\"nz-demo-message-other\" [nzLink]=\"'components-message-demo-other'\" nzGenerateCommand=\"ng g ng-zorro-antd:message-other -p app --name=\" nzComponentName=\"NzDemoMessageOtherComponent\" [nzCode]=\"other\" [nzRawCode]=\"otherRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/message/demo/other.md'\">\n\t<nz-demo-message-other demo></nz-demo-message-other>\n\t<div intro ngNonBindable>\n\t\t<p>包括成功、失败、警告。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"加载中\" [nzId]=\"'components-message-demo-loading'\" nzSelector=\"nz-demo-message-loading\" [nzLink]=\"'components-message-demo-loading'\" nzGenerateCommand=\"ng g ng-zorro-antd:message-loading -p app --name=\" nzComponentName=\"NzDemoMessageLoadingComponent\" [nzCode]=\"loading\" [nzRawCode]=\"loadingRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/message/demo/loading.md'\">\n\t<nz-demo-message-loading demo></nz-demo-message-loading>\n\t<div intro ngNonBindable>\n\t\t<p>进行全局 loading，异步自行移除。</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n</div>\n<section class=\"markdown api-container\" ngNonBindable><h2 id=\"api\"><span>API</span><a onclick=\"window.location.hash = 'api'\" class=\"anchor\">#</a></h2><h3 id=\"nzmessageservice\"><span>NzMessageService</span><label class=\"api-type-label service\">service</label><a onclick=\"window.location.hash = 'nzmessageservice'\" class=\"anchor\">#</a></h3><p>组件提供了一些服务方法，使用方式和参数如下：</p>\n<ul>\n<li><code>NzMessageService.success(content, [options])</code></li>\n<li><code>NzMessageService.error(content, [options])</code></li>\n<li><code>NzMessageService.info(content, [options])</code></li>\n<li><code>NzMessageService.warning(content, [options])</code></li>\n<li><code>NzMessageService.loading(content, [options])</code></li>\n</ul>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>content</td>\n<td>提示内容</td>\n<td>string</td>\n<td>-</td>\n</tr>\n<tr>\n<td>options</td>\n<td>支持设置针对当前提示框的参数，见下方表格</td>\n<td>object</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n<p><code>options</code> 支持设置的参数如下：</p>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzDuration</td>\n<td>持续时间(毫秒)，当设置为0时不消失</td>\n<td>number</td>\n</tr>\n<tr>\n<td>nzPauseOnHover</td>\n<td>鼠标移上时禁止自动移除</td>\n<td>boolean</td>\n</tr>\n<tr>\n<td>nzAnimate</td>\n<td>开关动画效果</td>\n<td>boolean</td>\n</tr>\n</tbody>\n</table>\n<p>还提供了全局销毁方法：</p>\n<ul>\n<li><code>NzMessageService.remove(id)</code> // 移除特定id的消息，当id为空时，移除所有消息（该消息id通过上述方法返回值中得到）</li>\n</ul>\n<h3 id=\"全局配置（nz_message_config）\"><span>全局配置（NZ_MESSAGE_CONFIG）</span><a onclick=\"window.location.hash = '全局配置（nz_message_config）'\" class=\"anchor\">#</a></h3><table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>nzDuration</td>\n<td>持续时间(毫秒)，当设置为0时不消失</td>\n<td>number</td>\n<td>3000</td>\n</tr>\n<tr>\n<td>nzMaxStack</td>\n<td>同一时间可展示的最大提示数量</td>\n<td>number</td>\n<td>8</td>\n</tr>\n<tr>\n<td>nzPauseOnHover</td>\n<td>鼠标移上时禁止自动移除</td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n<tr>\n<td>nzAnimate</td>\n<td>开关动画效果</td>\n<td>boolean</td>\n<td>true</td>\n</tr>\n</tbody>\n</table>\n</section></article>"

